import "./Dialogs.css";

const Dialogs = (props) => {
  return (
    <div className="dialogs">
      <div className="dialogs-items">
        <div className="item">Maria</div>
        <div className="item">Anna</div>
        <div className="item">Ani</div>
        <div className="item">Armen</div>
        <div className="item">Artak</div>
      </div>
    </div>
  );
};

export default Dialogs;
